  // },
  partnerHeader:{
    marginTop:'15px',
    color:'pink',
    float:'right',
    display:'flex'
  },
  bothButtons:{
    float:'right',
    marginTop:'15px',
    margin:'10px',
  },
  partnerHeaderText:{
    marginTop:'20px'
  }
}));
export  default useStyles;
